import Sidebar from '../Sidebar/Sidebar'

export default class extends Component {
    render() {
        return (
            <React.Fragment>
            <Sidebar/>
            <div style="margin-left:25%">
                ... page content ...
            </div>
            </React.Fragment>
        )
    }
}
